    <AboutWrap>
      <div className="content">
        <div>
          <div className="variable">
            <span className="work">FRONT</span>END
          </div>
          <div className="static">developer</div>
        </div>
        <p>STUDIO CYLO</p>
        <h3>Stay hungry</h3>
        <h3>Stay foolish</h3>
      </div>
    </AboutWrap>
  );
};

const AboutWrap = styled.section`
  width: 100%;
  min-height: 100vh;
  background-color: #000;
  padding: 10rem 24px 0;
  .content {
    position: relative;
  }

  .static {
    font-size: 30px;
    font-variation-settings: "wght" 900, "wdth" 200;
